const routes: Routes = [
 { path: '', redirectTo: 'employees', pathMatch: 'full' },
 { path: 'employees', component: EmployeesListComponent },
 //{ path: 'employees/new', component: AddEmployeeComponent },
 //{ path: 'employees/new', component: ReservationFormComponent },
 { path: 'employees/new/reservation/:id', component: SquareComponent },// <-- add this line
 { path: 'employees/new', component: CanvasComponent },
 { path: 'login', component: CanvasComponent },
 //{ path: 'employees/new', component: SquareComponent },
 { path: 'employees/edit/:id', component: EditEmployeeComponent }]; // <-- add this line


@NgModule({
 imports: [RouterModule.forRoot(routes)],
 exports: [RouterModule]
})
export class AppRoutingModule { }
